INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 1.47, 126401, "2023/09/22 14:59:59", "クローチェ", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 1, 1, 0.0, 10001, "2023/06/30 12:00:00", 2);
