INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 0.0, 127702, "2023/12/22 14:59:59", "リンド", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 2, 2, 0.0, 10005, "2023/09/15 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 0.0, 127702, "2023/12/22 14:59:59", "リンド", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2, 2, 0.0, 10006, "2023/09/15 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 0.0, 127802, "2023/12/22 14:59:59", "ヴルム", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 1, 2, 0.0, 10007, "2023/09/15 15:00:00", 1);
