INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 0.0, 129602, "2024/03/22 14:59:59", "アネモネ", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 2, 3, 0.0, 10010, "2023/12/15 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 0.0, 129701, "2024/03/22 14:59:59", "ネフィ=ネラ", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1, 3, 0.0, 10011, "2023/12/15 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 6.2, 129701, "2024/03/22 14:59:59", "ネフィ=ネラ", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 2, 3, 0.0, 10012, "2023/12/15 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 3.1, 130301, "2024/06/22 14:59:59", "カノン", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 3, 4, 0.0, 10013, "2024/03/15 15:00:00", 5);
