INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 0.0, 130401, "2024/06/22 14:59:59", "ナーナ", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 2, 4, 0.0, 10015, "2024/03/15 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 3.35, 130401, "2024/06/22 14:59:59", "ナーナ", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 2, 4, 0.0, 10016, "2024/03/15 15:00:00", 1);
