INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 4.9, 123301, "2024/09/22 14:59:59", "ネア", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 1, 5, 0.0, 10020, "2024/06/15 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 4.8, 123301, "2024/09/22 14:59:59", "ネア", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 1, 5, 0.0, 10021, "2024/06/15 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 4.922, 133301, "2024/12/22 14:59:59", "カリザ", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 3, 6, 0.0, 10022, "2024/09/15 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 9.638, 133301, "2024/12/22 14:59:59", "カリザ", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 3, 6, 0.0, 10023, "2024/09/15 15:00:00", 5);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 2.88, 133401, "2024/12/22 14:59:59", "ミーア", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 1, 6, 0.0, 10024, "2024/09/15 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 4.818, 133401, "2024/12/22 14:59:59", "ミーア", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 5, 6, 0.0, 10025, "2024/09/15 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 1.78, 133002, "2025/03/22 14:59:59", "グレイス", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 2, 7, 0.0, 10026, "2024/12/15 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 6.15, 133002, "2025/03/22 14:59:59", "グレイス", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 1, 7, 0.0, 10027, "2024/12/15 15:00:00", 7);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 4.28, 133102, "2025/03/22 14:59:59", "ヴァイオレット", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 6, 7, 0.0, 10028, "2024/12/15 15:00:00", 2);
