INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 5.53, 136902, "2025/06/23 14:59:59", "ルルィ", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 2, 8, 0.0, 10030, "2025/03/15 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 6.05, 136902, "2025/06/23 14:59:59", "ルルィ", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 9, 8, 0.0, 10031, "2025/03/15 15:00:00", 7);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 0.0, 137001, "2025/06/23 14:59:59", "デュラン", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 2, 8, 0.0, 10032, "2025/03/15 15:00:00", 1);
