INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 0.0, 135902, "2025/09/23 14:59:59", "サツキ", "おう\n好きなもん持ってきな", 2, 9, 0.0, 10034, "2025/06/16 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 4.935, 135902, "2025/09/23 14:59:59", "サツキ", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 1, 9, 0.0, 10035, "2025/06/16 15:00:00", 6);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 7.441, 135802, "2025/09/23 14:59:59", "ユキノ", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 2, 9, 0.0, 10036, "2025/06/16 15:00:00", 5);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 0.0, 135802, "2025/09/23 14:59:59", "ユキノ", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 7, 9, 0.0, 10037, "2025/06/16 15:00:00", 7);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 2.295, 130901, "2025/12/23 14:59:59", "クルル", "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 2, 10, 0.0, 10038, "2025/09/16 15:00:00", 2);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 6.281, 130901, "2025/12/23 14:59:59", "クルル", "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 1, 10, 0.0, 10039, "2025/09/16 15:00:00", 6);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 1, -470.0, 5.549, 137701, "2025/12/23 14:59:59", "ヴォルガーノ", "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 2, 10, 0.0, 10040, "2025/09/16 15:00:00", 1);
INSERT INTO `v1_d51f6b26fe39713f2fec67fb35da243a29c9c10b1b4254b84c6bfa3fc19547d3` VALUES (2002, 2, -470.0, 2.64, 137701, "2025/12/23 14:59:59", "ヴォルガーノ", "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 3, 10, 0.0, 10041, "2025/09/16 15:00:00", 6);
